import React from 'react';
import PlanCard from './util/PlanCard';

function Plans() {
  return (
      <div className='plans'>
        <h1>Elevate Your Academic Skills</h1>
        <div className='plan-row'>
            <PlanCard 
                name='Free'
                amount='100'
                contains={['Create 2 exams', 'Create 2 section per exam', 'Maximum 20 Questions in a section', 'Timer Exam', 'Navigation ']}
            />
            <PlanCard
                name='Silver'
                amount='300'
                contains={['Create 5 exams', 'Create 1 user', 'Create 2 section per exam', 'Maximum 50 Questions in a section', 'Timer Exam/Section', 'Navigation']}
            />
            <PlanCard
                name='Gold'
                amount='500'
                contains={['Create 10 exams', 'Create 3 user', 'Create 5 section per exam', 'Maximum 100 Questions in a section', 'Timer Exam/Section/Question', 'Navigation settings']}
            />
        </div>
      </div>
  );
}

export default Plans;
